  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background-color: #ffffff;
  padding: 20px;
`;

export const WelcomeMessage = styled.h1`
  color: #333;
  font-size: 2.5rem;
